import React from 'react';
import { CheckIcon, InProgressIcon } from '../../asset/icons/box/index.js';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';

const steps = ['Confirmed', 'In Progress', 'Ready'];

// Custom step icon component
const StepIconComponent = (props) => {
  const { completed } = props;
  return completed ? <CheckIcon /> : <InProgressIcon />;
};

const StepLabelComponent = (props) => {
  const { label, active } = props;
  return (
    <div className={`step flex flex-col items-center mx-10`}>
      <p className={`text-sm text-center overflow-hidden truncate whitespace-nowrap ${active ? 'text-primary' : 'text-gray'}`}>{label}</p>
    </div>
  );
};

const Progress = ({ currentStep }) => (
  <Stepper activeStep={currentStep} alternativeLabel>
    {steps.map((label, index) => (
      <Step key={label}>
        <StepLabel StepIconComponent={StepIconComponent} StepLabelComponent={props => <StepLabelComponent {...props} label={label} />} />
      </Step>
    ))}
  </Stepper>
);

export default Progress;
